INSERT INTO items (id, dimension_id, text, is_reverse, is_anchor, is_attention_check, sort_order) VALUES
('e4000000-0000-0000-0000-000000000001', 'd4000000-0000-0000-0000-000000000001', 'Me siento orgulloso/a de pertenecer a esta organización.', false, true, false, 1),
('e4000000-0000-0000-0000-000000000002', 'd4000000-0000-0000-0000-000000000002', 'Mi trabajo tiene un propósito claro que me motiva.', false, true, false, 2),
('e4000000-0000-0000-0000-000000000003', 'd4000000-0000-0000-0000-000000000003', 'Me siento seguro/a emocional y psicológicamente en mi lugar de trabajo.', false, true, false, 3),
('e4000000-0000-0000-0000-000000000004', 'd4000000-0000-0000-0000-000000000004', 'Puedo mantener un equilibrio saludable entre mi vida personal y laboral.', false, true, false, 4),
('e4000000-0000-0000-0000-000000000005', 'd4000000-0000-0000-0000-000000000005', 'En mi equipo nos apoyamos mutuamente cuando alguien tiene dificultades.', false, true, false, 5),
('e4000000-0000-0000-0000-000000000006', 'd4000000-0000-0000-0000-000000000006', 'Mi supervisor me brinda retroalimentación específica que me ayuda a mejorar.', false, true, false, 6),
('e4000000-0000-0000-0000-000000000007', 'd4000000-0000-0000-0000-000000000007', 'Tengo la libertad de decidir cómo organizar y realizar mi trabajo.', false, true, false, 7),
('e4000000-0000-0000-0000-000000000008', 'd4000000-0000-0000-0000-000000000008', 'La comunicación en la organización es clara, oportuna y transparente.', false, true, false, 8),
('e4000000-0000-0000-0000-000000000009', 'd4000000-0000-0000-0000-000000000009', 'Confío en las decisiones que toma la alta dirección de la organización.', false, true, false, 9),
('e4000000-0000-0000-0000-000000000010', 'd4000000-0000-0000-0000-000000000010', 'Considero que mi compensación es justa en relación con mi trabajo y responsabilidades.', false, true, false, 10),
('e4000000-0000-0000-0000-000000000011', 'd4000000-0000-0000-0000-000000000011', 'Recibo reconocimiento oportuno cuando hago un buen trabajo.', false, true, false, 11),
('e4000000-0000-0000-0000-000000000012', 'd4000000-0000-0000-0000-000000000012', 'Los beneficios que ofrece la organización responden a mis necesidades.', false, true, false, 12),
('e4000000-0000-0000-0000-000000000013', 'd4000000-0000-0000-0000-000000000013', 'Los procesos de promoción en la organización son transparentes y justos.', false, true, false, 13),
('e4000000-0000-0000-0000-000000000014', 'd4000000-0000-0000-0000-000000000014', 'En mi equipo trabajamos de manera colaborativa para alcanzar los objetivos.', false, true, false, 14),
('e4000000-0000-0000-0000-000000000015', 'd4000000-0000-0000-0000-000000000015', 'En esta organización se fomenta la innovación y las nuevas ideas.', false, true, false, 15),
('e4000000-0000-0000-0000-000000000016', 'd4000000-0000-0000-0000-000000000016', 'Tengo claridad sobre los objetivos que debo alcanzar en mi puesto.', false, true, false, 16),
('e4000000-0000-0000-0000-000000000017', 'd4000000-0000-0000-0000-000000000017', 'La organización me ofrece oportunidades reales de desarrollo profesional.', false, true, false, 17),
('e4000000-0000-0000-0000-000000000018', 'd4000000-0000-0000-0000-000000000018', 'Me siento entusiasmado/a con mi trabajo cada día.', false, true, false, 18),
('e4000000-0000-0000-0000-000000000019', 'd4000000-0000-0000-0000-000000000019', 'Tengo claridad sobre mis responsabilidades y los límites de mi rol.', false, true, false, 19),
('e4000000-0000-0000-0000-000000000020', 'd4000000-0000-0000-0000-000000000020', 'Mi carga de trabajo es manejable y razonable.', false, true, false, 20),
('e4000000-0000-0000-0000-000000000021', 'd4000000-0000-0000-0000-000000000021', 'En esta organización aprendemos de nuestros errores y aplicamos esas lecciones para mejorar.', false, true, false, 21),
('e4000000-0000-0000-0000-000000000022', 'd4000000-0000-0000-0000-000000000022', 'Las personas son tratadas con justicia independientemente de su edad.', false, true, false, 22);
