('ca000000-0000-0000-0000-000000000001', 'aa000000-0000-0000-0000-000000000039', 'strength', 'El liderazgo de mi supervisor es excepcional, siempre está disponible para apoyarnos.'),
('ca000000-0000-0000-0000-000000000002', 'aa000000-0000-0000-0000-000000000023', 'strength', 'Me siento muy orgulloso de trabajar aquí, es una empresa con valores sólidos.'),
('ca000000-0000-0000-0000-000000000003', 'aa000000-0000-0000-0000-000000000052', 'strength', 'La colaboración entre equipos es una de las mayores fortalezas de la organización.'),
('ca000000-0000-0000-0000-000000000004', 'aa000000-0000-0000-0000-000000000029', 'strength', 'Valoro mucho la autonomía que me dan para realizar mi trabajo.'),
('ca000000-0000-0000-0000-000000000005', 'aa000000-0000-0000-0000-000000000014', 'strength', 'El ambiente laboral es muy positivo y los compañeros son solidarios.'),
('ca000000-0000-0000-0000-000000000006', 'aa000000-0000-0000-0000-000000000041', 'improvement', 'La compensación debería ser más competitiva respecto al mercado.'),
('ca000000-0000-0000-0000-000000000007', 'aa000000-0000-0000-0000-000000000043', 'improvement', 'Necesitamos más oportunidades de desarrollo y capacitación.'),
('ca000000-0000-0000-0000-000000000008', 'aa000000-0000-0000-0000-000000000014', 'improvement', 'La comunicación interna podría mejorar, a veces nos enteramos tarde de cambios importantes.'),
('ca000000-0000-0000-0000-000000000009', 'aa000000-0000-0000-0000-000000000041', 'improvement', 'Los procesos de promoción no siempre son transparentes.'),
('ca000000-0000-0000-0000-000000000010', 'aa000000-0000-0000-0000-000000000046', 'improvement', 'Sería bueno tener más flexibilidad para el balance vida-trabajo.'),
('ca000000-0000-0000-0000-000000000011', 'aa000000-0000-0000-0000-000000000052', 'general', 'En general estoy satisfecho con mi experiencia en la empresa.'),
('ca000000-0000-0000-0000-000000000012', 'aa000000-0000-0000-0000-000000000011', 'general', 'Creo que vamos por buen camino pero hay áreas claras de mejora.'),
