('ca000000-0000-0000-0000-000000000014', 'aa000000-0000-0000-0000-000000000060', 'general', 'La empresa ha mejorado mucho en el último año.'),
('ca000000-0000-0000-0000-000000000015', 'aa000000-0000-0000-0000-000000000079', 'general', 'Espero que los resultados de esta encuesta se traduzcan en acciones concretas.');
