INSERT INTO open_responses (id, respondent_id, question_type, text) VALUES
('cb000000-0000-0000-0000-000000000001', 'ab000000-0000-0000-0000-000000000012', 'strength', 'El liderazgo de mi supervisor es excepcional, siempre está disponible para apoyarnos.'),
('cb000000-0000-0000-0000-000000000002', 'ab000000-0000-0000-0000-000000000018', 'strength', 'Me siento muy orgulloso de trabajar aquí, es una empresa con valores sólidos.'),
('cb000000-0000-0000-0000-000000000003', 'ab000000-0000-0000-0000-000000000102', 'strength', 'La colaboración entre equipos es una de las mayores fortalezas de la organización.'),
('cb000000-0000-0000-0000-000000000004', 'ab000000-0000-0000-0000-000000000060', 'strength', 'Valoro mucho la autonomía que me dan para realizar mi trabajo.'),
('cb000000-0000-0000-0000-000000000005', 'ab000000-0000-0000-0000-000000000100', 'strength', 'El ambiente laboral es muy positivo y los compañeros son solidarios.'),
('cb000000-0000-0000-0000-000000000006', 'ab000000-0000-0000-0000-000000000053', 'improvement', 'La compensación debería ser más competitiva respecto al mercado.'),
('cb000000-0000-0000-0000-000000000007', 'ab000000-0000-0000-0000-000000000087', 'improvement', 'Necesitamos más oportunidades de desarrollo y capacitación.'),
('cb000000-0000-0000-0000-000000000008', 'ab000000-0000-0000-0000-000000000022', 'improvement', 'La comunicación interna podría mejorar, a veces nos enteramos tarde de cambios importantes.'),
('cb000000-0000-0000-0000-000000000009', 'ab000000-0000-0000-0000-000000000111', 'improvement', 'Los procesos de promoción no siempre son transparentes.'),
('cb000000-0000-0000-0000-000000000010', 'ab000000-0000-0000-0000-000000000110', 'improvement', 'Sería bueno tener más flexibilidad para el balance vida-trabajo.'),
('cb000000-0000-0000-0000-000000000011', 'ab000000-0000-0000-0000-000000000064', 'general', 'En general estoy satisfecho con mi experiencia en la empresa.'),
('cb000000-0000-0000-0000-000000000012', 'ab000000-0000-0000-0000-000000000019', 'general', 'Creo que vamos por buen camino pero hay áreas claras de mejora.'),
('cb000000-0000-0000-0000-000000000013', 'ab000000-0000-0000-0000-000000000075', 'general', 'Me gustaría que se implementaran más iniciativas de bienestar.'),
('cb000000-0000-0000-0000-000000000014', 'ab000000-0000-0000-0000-000000000009', 'general', 'La empresa ha mejorado mucho en el último año.'),
('cb000000-0000-0000-0000-000000000015', 'ab000000-0000-0000-0000-000000000006', 'general', 'Espero que los resultados de esta encuesta se traduzcan en acciones concretas.');
